window.bookSummaryJSON = "<p>Raeth is the Walker in Shadows, a legend made flesh, the greatest thief in the world. He has money, connections, and fame — everything should be perfect.&nbsp;&nbsp;</p> <p>Everything but that scarred necromancer who is blackmailing him.&nbsp;</p> <p>To become the greatest thief in Aorlis, Raeth has made a few “questionable” choices and taken missions that should have been refused. Who achieves greatness without a few mistakes along the way? Now, those old choices have returned with a vengeance, and for Raeth, it’s a do or die dilemma.&nbsp;</p> <p>Raeth has to maneuver through a maze of professional assassins, vengeful pirates, and a secret concealed in the shadows — a secret that threatens to consume him.&nbsp;</p>"; 
